== Rename to "Pećanac Chetniks" ==

The article should probably be moved to "Pećanac Chetniks". Its a far less clumsy name and I'd beta a lot more common. --<font face="Eras Bold ITC">[[User:DIREKTOR|<font color="DimGray">DIREKTOR</font>]] <sup>([[User talk:DIREKTOR|<font color="Gray">TALK</font>]])</sup></font> 02:27, 1 February 2011 (UTC)

This article should probably be referenced in the lede of the Chetniks article to make it clear there were two Chetnik organisations. [[User:Peacemaker67|Peacemaker67]] ([[User talk:Peacemaker67|talk]]) 06:20, 12 November 2011 (UTC)

:Why don't we just merge it into the main article? <span style="text-shadow: 0.2em 0.2em 0.1em #DDDDDD">--[[User:Nuujinn|Nuujinn]] ([[User_talk:Nuujinn|talk]])</span> 00:52, 21 November 2011 (UTC)

::I'd prefer that. To me, the Chetniks article should cover all aspects of the Chetnik movement (which is why I consider the 'Yugoslav Army of the Fatherland' should be removed from the first line), and despite the minor role Pecanac played, he is part of the rich tapestry of the pre-war Chetnik movement, and it needs to be made clear that the movement formed by Mihailovic was not an expansion of the formal pre-war Chetnik movement, but a new branch of Chetnik development drawing on general Chetnik traditions. Several sources are available for that. [[User:Peacemaker67|Peacemaker67]] ([[User talk:Peacemaker67|talk]]) 04:39, 21 November 2011 (UTC)

